import React, { Component } from 'react';

import '../Assets/Css/MVAnimate.css';

const MVAnimate = ({ classStyle, classAnimation, text }) => (
    <div className={`${classStyle} ${classAnimation}`}>
        <div><p>{text}</p></div>
    </div>
);

export default MVAnimate;
